import React from 'react'
import { Link } from 'react-router-dom'

function Home() {
    return (
        <>
            <Link to="/api/users">Lista de Usuarios</Link><br></br>
            <Link to="/api/products">Lista de Peliculas</Link>
        </>
    )
}

export default Home
